import React from 'react';
import StartButton from './components/StartButton';
import SelectionButton from './components/SelectionButton';
import Spinner from './components/Spinner';
import './styles/App.css';
//import Calendly from './components/Calendar';
// import Navbar from './components/Navbar';
import { useAuth0 } from "@auth0/auth0-react";
import { Layout, Menu } from 'antd';
import { UploadOutlined, UserOutlined, VideoCameraOutlined } from '@ant-design/icons';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
/*import Header from './components/Header';*/
import FileUploadPage from './components/uploadFile';
import LogoutButton from './components/LogoutButton';

const { Header, Content, Footer, Sider } = Layout;


function App() {

  const { isLoading, isAuthenticated } = useAuth0();

  if (isLoading) { return (<div className='container'><Spinner/></div>) };
  if (!isAuthenticated) { return (<div className='container'><StartButton/></div>) };


  return ( 
    <Layout>
        <Sider style={{background:'black'}} breakpoint="lg"
      collapsedWidth="0"
      onBreakpoint={broken => {
        console.log(broken);
      }}
      onCollapse={(collapsed, type) => {
        console.log(collapsed, type);
      }}>
        <Menu theme="dark" mode="inline" defaultSelectedKeys={['4']}>
          <Menu.Item key="1" icon={<UserOutlined />}>
            nav 1
          </Menu.Item>
          <Menu.Item key="2" icon={<VideoCameraOutlined />}>
            nav 2
          </Menu.Item>
          <Menu.Item key="3" icon={<UploadOutlined />}>
            nav 3
          </Menu.Item>
          <Menu.Item key="4" icon={<UserOutlined />}>
            nav 4
          </Menu.Item>
        </Menu>
      </Sider>
         <Layout>
            <Header style={{background:'black', opacity:'85%'}}>
              <LogoutButton/>
            </Header>
            <Content className="container">
            <Router>
              <Switch>
                <div>
                <Route path="/Home">
                  <FileUploadPage/>
                </Route>
                <Route path="/Dashboard">
                </Route>
                <Route path="/">
                  <SelectionButton name='Matching' path="/Dashboard"/>
                  <SelectionButton name='Scheduling' path="/Home"/>
                </Route>
                </div>
              </Switch>
            </Router>
            </Content>
            <Footer style={{background:'#111111'}}></Footer>
          </Layout>
     </Layout>
  );
}

export default App;
